import React from "react";
import { useHistory } from "react-router-dom";

const history = useHistory();
const routeChange = () => {
  let path = "newPath";
  history.push(path);
  return (
    <div>
      <Button color="primary" className="px-4" onClick={routeChange}>
        Play Game
      </Button>
    </div>
  );
};
